// ==UserScript==
// @name         Ukrposhta sticker to envelope converter
// @namespace    UPSC
// @version      2025-11-15
// @description  Convert mail stickers to envelopes in pdf format
// @author       Afftamat
// @license      MIT
// @match        https://ok.ukrposhta.ua/ua/lk/*
// @icon         https://ok.ukrposhta.ua/design/images/favicons/icon-64x64.png
// @grant        GM_addStyle
// @grant        GM_addElement
// @grant        unsafeWindow
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM.setValue
// @grant        GM.getValue
// @downloadURL https://update.greasyfork.org/scripts/555907/Ukrposhta%20sticker%20to%20envelope%20converter.user.js
// @updateURL https://update.greasyfork.org/scripts/555907/Ukrposhta%20sticker%20to%20envelope%20converter.meta.js
// ==/UserScript==
/* globals jQuery, $, waitForKeyElements */

(function() {

    GM_addStyle('.upsc-btn { margin-top:2px; font-weight:bold; padding:6px 11px } .upsc-outnumber-input { width:100px }');
    GM_addStyle('.upsc-blinking { border:2px solid red; background-color:lightpink }');

    var UPSCmailIDs = JSON.parse(localStorage.getItem('UPSCmailIDs')) || [];

    var UPSCwaitForJQ = setInterval(function(){ // Waiting for JQ
        if(typeof jQuery === "function"){
            clearInterval(UPSCwaitForJQ);
            console.log('UPSC: sticker to envelope converter started');

            $('.shipment-list-table').hide();

            $('body').append('<canvas id="upsc-canvas" style="display:none"></canvas>');

            $.getScript('https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.6.347/pdf.min.js');
            $.getScript('https://cdnjs.cloudflare.com/ajax/libs/jspdf/3.0.3/jspdf.umd.min.js');

            var UPSCwaitForShipmentTable = setInterval(function(){ // Waiting for the shipment table to load
                if($('.shipment-list-table > tbody > tr').length > 0){
                    clearInterval(UPSCwaitForShipmentTable);
                    console.log('UPSC: shipment table loaded');

                    $('.shipment-list-table > tbody > tr').each(function(index, element){
                        var UPSCbarcodeNum = $(this).find('a.barcode-num').text();
                        var UPSCoutNum = (UPSCmailIDs.find(x => x.barcodenum == UPSCbarcodeNum) || {outnum:''}).outnum;

                        $(this).find('td:eq(4)').text($(this).find('td:eq(4)').text().replace(/\[Доставка:  null\]/g, ''));

                        $(this).find('td:eq(2)').prepend('<input class="upsc-outnumber-input" type="text" placeholder="Вихідний №" value="'+ UPSCoutNum +'" data-barcodenum="'+ UPSCbarcodeNum +'"/>');

                        $(this).find('td:last').append('<button class="upsc-btn upsc-btn-dl btn account-btn-primary" type="button" data-barcodenum="'+ UPSCbarcodeNum +'">DL</button>');
                        $(this).find('td:last').append('<button class="upsc-btn upsc-btn-a5 btn account-btn-primary" type="button" data-barcodenum="'+ UPSCbarcodeNum +'">A5</button>');
                        $(this).find('td:last').append('<button class="upsc-btn upsc-btn-a4 btn account-btn-primary" type="button" data-barcodenum="'+ UPSCbarcodeNum +'">A4</button>');
                    });

                    $('.shipment-list-table').show();

                    // Handling outgoing number changes
                    $('.upsc-outnumber-input').change(function(){
                        var UPSCbarcodeNum = $(this).data('barcodenum');
                        var UPSCoutNum = $(this).val();
                        var i = UPSCmailIDs.findIndex(x => x.barcodenum == UPSCbarcodeNum);

                        if(i >= 0) {
                            UPSCmailIDs[i].outnum = UPSCoutNum;
                        }
                        else {
                            UPSCmailIDs.push({outnum:UPSCoutNum, barcodenum:UPSCbarcodeNum});
                        }
                        localStorage.setItem('UPSCmailIDs', JSON.stringify(UPSCmailIDs));
                    });


                    // Generating DL size envelope
                    $('.upsc-btn-dl').click(function(){

                        var button = this;
                        $(button).prop('disabled', true);

                        var barcodeNum = $(this).data('barcodenum');
                        var outNum = $('input[data-barcodenum="'+ barcodeNum +'"]').val();

                        if(outNum.length < 1) {
                            $('input[data-barcodenum="'+ barcodeNum +'"]').focus().addClass('upsc-blinking');
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 1000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 1500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 2000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); $(button).prop('disabled', false); }, 2500);
                            return;
                        }

                        pdfjsLib.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.6.347/pdf.worker.min.js';
                        var loadingTask = pdfjsLib.getDocument('https://ok.ukrposhta.ua/ua/lk/print/sticker/'+ barcodeNum);
                        loadingTask.promise.then(function(pdf) {
                            var pageNumber = 1;
                            pdf.getPage(pageNumber).then(function(page) {
                                var scale = 2;
                                var viewport = page.getViewport({scale: scale});
                                var canvas = document.getElementById('upsc-canvas');
                                var context = canvas.getContext('2d');
                                canvas.height = viewport.height;
                                canvas.width = viewport.width;
                                var renderContext = {
                                    canvasContext: context,
                                    viewport: viewport
                                };
                                var renderTask = page.render(renderContext);
                                renderTask.promise.then(function () {
                                    var doc = new jspdf.jsPDF({
                                        orientation: 'l',
                                        unit: 'cm',
                                        format: [11, 22]
                                    });

                                    doc.text('1772/'+ outNum, 2, 1.5, {align:'left', charSpace:0, flags:'autoencode'});
                                    doc.addImage(canvas, 12, 1, 9, 9);
                                    doc.addImage(chevron77, 2, 7.2, 2.5, 2.8);

                                    doc.save('Конверт '+ outNum +'.pdf');
                                    $(button).prop('disabled', false);
                                });
                            });
                        }, function (reason) {
                            console.error(reason);
                            $(button).prop('disabled', false);
                        });
                    });


                    // Generating A4 size envelope
                    $('.upsc-btn-a4').click(function(){

                        var button = this;
                        $(button).prop('disabled', true);

                        var barcodeNum = $(this).data('barcodenum');
                        var outNum = $('input[data-barcodenum="'+ barcodeNum +'"]').val();

                        if(outNum.length < 1) {
                            $('input[data-barcodenum="'+ barcodeNum +'"]').focus().addClass('upsc-blinking');
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 1000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 1500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 2000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); $(button).prop('disabled', false); }, 2500);
                            return;
                        }

                        pdfjsLib.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.6.347/pdf.worker.min.js';
                        var loadingTask = pdfjsLib.getDocument('https://ok.ukrposhta.ua/ua/lk/print/sticker/'+ barcodeNum);
                        loadingTask.promise.then(function(pdf) {
                            var pageNumber = 1;
                            pdf.getPage(pageNumber).then(function(page) {
                                var scale = 2;
                                var viewport = page.getViewport({scale: scale});
                                var canvas = document.getElementById('upsc-canvas');
                                var context = canvas.getContext('2d');
                                canvas.height = viewport.height;
                                canvas.width = viewport.width;
                                var renderContext = {
                                    canvasContext: context,
                                    viewport: viewport
                                };
                                var renderTask = page.render(renderContext);
                                renderTask.promise.then(function () {
                                    var doc = new jspdf.jsPDF({
                                        orientation: 'l',
                                        unit: 'cm',
                                        format: 'a4'
                                    });

                                    doc.text('1772/'+ outNum, 1, 3.7, {align:'left', charSpace:0, flags:'autoencode'});
                                    doc.addImage(canvas, 16.7, 10, 10, 10);
                                    doc.addImage(chevron77, 24.2, 3, 2.5, 2.8);

                                    doc.save('Конверт '+ outNum +'.pdf');
                                    $(button).prop('disabled', false);
                                });
                            });
                        }, function (reason) {
                            console.error(reason);
                            $(button).prop('disabled', false);
                        });
                    });


                    // Generating A5 size envelope
                    $('.upsc-btn-a5').click(function(){

                        var button = this;
                        $(button).prop('disabled', true);

                        var barcodeNum = $(this).data('barcodenum');
                        var outNum = $('input[data-barcodenum="'+ barcodeNum +'"]').val();

                        if(outNum.length < 1) {
                            $('input[data-barcodenum="'+ barcodeNum +'"]').focus().addClass('upsc-blinking');
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 1000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); }, 1500);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').addClass('upsc-blinking'); }, 2000);
                            setTimeout(function(){ $('input[data-barcodenum="'+ barcodeNum +'"]').removeClass('upsc-blinking'); $(button).prop('disabled', false); }, 2500);
                            return;
                        }

                        pdfjsLib.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.6.347/pdf.worker.min.js';
                        var loadingTask = pdfjsLib.getDocument('https://ok.ukrposhta.ua/ua/lk/print/sticker/'+ barcodeNum);
                        loadingTask.promise.then(function(pdf) {
                            var pageNumber = 1;
                            pdf.getPage(pageNumber).then(function(page) {
                                var scale = 2;
                                var viewport = page.getViewport({scale: scale});
                                var canvas = document.getElementById('upsc-canvas');
                                var context = canvas.getContext('2d');
                                canvas.height = viewport.height;
                                canvas.width = viewport.width;
                                var renderContext = {
                                    canvasContext: context,
                                    viewport: viewport
                                };
                                var renderTask = page.render(renderContext);
                                renderTask.promise.then(function () {
                                    var doc = new jspdf.jsPDF({
                                        orientation: 'l',
                                        unit: 'cm',
                                        format: 'a5'
                                    });

                                    doc.text('1772/'+ outNum, 1, 2.5, {align:'left', charSpace:0, flags:'autoencode'});
                                    doc.addImage(canvas, 10, 4, 9, 10);
                                    doc.addImage(chevron77, 1, 11.2, 2.5, 2.8);

                                    doc.save('Конверт '+ outNum +'.pdf');
                                    $(button).prop('disabled', false);
                                });
                            });
                        }, function (reason) {
                            console.error(reason);
                            $(button).prop('disabled', false);
                        });
                    });
                }
            }, 100);
        }
    }, 100);

    var chevron77 = 'data:image/png;base64,';

})();